import React from 'react';
import {Link} from 'react-router-dom';

export default function NavBar() {
    return (
    <nav>
        <ul>
            <li>Alpha Bank</li>
            <li>
                <Link to="/">Home</Link>
            </li>
            <li>
                <Link to="/location">Location</Link>
            </li>
            <li>
                <Link to="/about">About</Link>
            </li>
        </ul>
    </nav>
    )
}
